import React from "react";

function HomePage() {
  return (
    <>
      <h2>This is Home Page</h2>
      <h2>Welcome to my shop</h2>
      <p>Oreder Groceries at your local store</p>
      <p>Click tab above to order</p>
    </>
  );
}

export default HomePage;
